import React from "react";

function TicketList({ tickets, onEdit }) {
    return (
        <ul>
            {tickets.map((ticket) => (
                <li key={ticket.id}>
                    <h3>{ticket.title}</h3>
                    <p>{ticket.description}</p>
                    <p>Status: {ticket.status}</p>
                    <p>Priority: {ticket.priority}</p>
                    <button onClick={() => onEdit(ticket)}>Edytuj</button>
                </li>
            ))}
        </ul>
    );
}

export default TicketList;
